The One Big Beautiful Bill cuts taxes for working and middle-class families, strengthens the safety net for our most vulnerable populations, and gets our fiscal house back in order.

@POTUS continues to deliver for America. Promises made, promises kept.
https://t.co/ZywpH8Oslk

Our One Big Beautiful Bill will reduce the deficit by $1.4 trillion over the next 10 years.

Kansans voted for Washington, D.C. to lower taxes, reduce the size of the federal government, and get our country back on track.

@HouseGOP is getting our fiscal house back in order by passing the One Big Beautiful Bill Act to usher in a new era of economic prosperity.

Agriculture is the backbone of America, and our farmers, ranchers, and agricultural producers shouldn’t be left guessing about the future.

@HouseAgGOP took a once-in-a-generation opportunity to deliver certainty and tools our agriculture community needs to keep feeding, fueling, and clothing the world.

Food security is national security, and we can’t afford to put that security at risk.

Kansans know Green New Deal policies don’t work for us in Middle America.

We need an all-of-the-above energy strategy that utilizes the resources in our own backyard and promotes American energy dominance.

@HouseGOP and @POTUS are rolling back burdensome regulations that handcuff energy producers, private landowners, and rural America. Enough is enough.

President Trump & @SecDuffy made it clear that we need to bring our air traffic control into the modern era to strengthen aviation safety.

Yesterday, I voted to invest in our air traffic control to modernize our outdated ATC technology, improve aviation safety for Americans, and address problems that have long gone ignored.

@POTUS, @TransportGOP, and @HouseGOP are delivering on the mandate America gave Washington D.C. by investing in our national security. Promises made, promises kept.

The President promised to secure our southern border, unleash American energy dominance, and decrease our outrageous federal spending.

@HouseGOP is working around the clock to codify @POTUS' priorities.

More on House Republicans’ commitment to delivering on America’s mandate👇 https://t.co/jUH4tfSuP3

Since President Trump took office, ICE has arrested more illegal immigrants than the Biden-Harris Administration arrested in all of 2024.

@POTUS  made a promise to the country to stop the political theatre, enforce the rule of law, and secure our nation’s borders.

Promises made, promises kept.
